Category	Interracial, All Girl, Girl-Girl, Lesbian, Sweetheart Video's Lesbian Beauties Series

Director	Dana Vespoli
Starring	Cherie DeVille, Ivy Sherwood, Siri, Misty Stone, Sovereign Syre, Ashlyn Molloy, Chanell Heart, Layton Benton

The 12th volume of Sweetheart's popular series brings stunning black girls and white girls together in four passionate, sensual scenes packed with earth-shattering orgasms. Yoga teacher Cherie Deville comes head to head with bratty teen Ivy Sherwood. Gloomy goth girl Ashlynn Molloy gets a lesson in love from tutor Chanell Heart. Broken hearted Siri seeks advice from her husband's ex, Layton Benton, and lonely trophy wife Sovereign Syre gets extra special treatment from physical therapist Misty Stone. All these ladies demonstrate boundless enthusiasm for each other in this latest collection.


